import { Link } from "react-router-dom";

const RECIPE = [
  { id: "p1", title: "Recipe 1" },
  { id: "p2", title: "Recipe 2" },
  { id: "p3", title: "Recipe 3" },
];

export default function RecipePage() {
  return (
    <>
      <h4>hello i am a RECIPE page</h4>
      <ul>
        {RECIPE.map((recipe) => (
          <li key={recipe.id}>
            <Link to={recipe.id}>{recipe.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
}
